use std::fmt;

#[derive(Clone)]
pub struct Person {
    id: i32,
    pub name: String,
    pub age: i32,
    data: String,
}

impl Person {
    pub fn new(id: i32, name: String, age: i32) -> Person {
        Person { id, name, age, data: String::from(DATA) }
    }
}

impl fmt::Display for Person {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "Person {{ id: {} , name: {} , age: {} , data_length: {} }}", self.id, self.name, self.age, self.data.len())
    }
}

pub struct PersonOverview {
    pub description: String,
}

impl fmt::Display for PersonOverview {
    fn fmt(&self, f: &mut fmt::Formatter<'_>) -> fmt::Result {
        write!(f, "PersonOverview {{ description: {} }}", self.description)
    }
}


